import React, { Component } from 'react';
import Logo from'../logo/Logo.png';
import '../App.css'



class TopNav extends Component {
    render() {
        return (

  <div class="topnav">
      <div className="logo">
              <img src={Logo} alt=""/>
          </div>
      <div>
          <div>
  <a class="active" href="#home">Home</a>
  <a href="#news">News</a>
  <a href="#contact">Contact</a>
  <a href="#about">About</a>
  </div>
</div>
            </div>
        );
    }
}

export default TopNav;
